    private void hubungandetails(JSONArray j) {
        kerabatList.clear();
        for (int i = 0; i < j.length(); i++) {
            try {
                JSONObject json = j.getJSONObject(i);
                String namahubungan = json.getString("nama_hubungan");
                kerabatList.add(namahubungan);
                Log.d("liswaris",namahubungan);
            } catch (JSONException e) {
                e.printStackTrace();
            }
        }

        hubungankerabat.setAdapter(new ArrayAdapter<String>(LengkapiProfilWali.this, android.R.layout.simple_spinner_dropdown_item, kerabatList));
    }


