    private class Provinsi implements Comparable<Provinsi> {

        private int provinsiID;
        private String provinsiName;


        public Provinsi(int provinsiID, String provinsiName) {
            this.provinsiID = provinsiID;
            this.provinsiName = provinsiName;
        }

        public int getProvinsiID() {
            return provinsiID;
        }

        public String getProvinsiName() {
            return provinsiName;
        }

        @Override
        public String toString() {
            return provinsiName;
        }


        @Override
        public int compareTo(Provinsi another) {
            return this.getProvinsiID() - another.getProvinsiID();//ascending order
//            return another.getCountryID()-this.getCountryID();//descending  order
        }
    }
    private class Kota implements Comparable<Kota> {

        private int kotaID;
        private Provinsi provinsi;
        private String kotaName;

        public Kota(int kotaID, Provinsi provinsi, String kotaName) {
            this.kotaID = kotaID;
            this.provinsi = provinsi;
            this.kotaName = kotaName;
        }

        public int getKotaID() {
            return kotaID;
        }

        public Provinsi getProvinsi() {
            return provinsi;
        }

        public String getStateName() {
            return kotaName;
        }

        @Override
        public String toString() {
            return kotaName;
        }

        @Override
        public int compareTo(Kota another) {
            return this.getKotaID() - another.getKotaID();//ascending order
//            return another.getStateID()-this.getStateID();//descending order
        }
    }
    private class Kecamatan implements Comparable<Kecamatan> {

        private int kecamatanID;
        private Kota kota;
        private String kecamatanName;

        public Kecamatan(int kecamatanID, Kota kota, String kecamatanName) {
            this.kecamatanID = kecamatanID;
            this.kota = kota;
            this.kecamatanName = kecamatanName;
        }

        public int getKecamatanID() {
            return kecamatanID;
        }

        public Kota getKota() {
            return kota;
        }

        public String getKecamatanName() {
            return kecamatanName;
        }

        @Override
        public String toString() {
            return kecamatanName;
        }

        @Override
        public int compareTo(Kecamatan another) {
            return this.kecamatanID - another.getKecamatanID();//ascending order
//            return another.getCityID() - this.cityID;//descending order
        }
    }
    @Override
    public Resources.Theme getTheme() {
        Resources.Theme theme = super.getTheme();
        Intent intent = getIntent();
        if (intent.hasExtra("pengaturan")) {
            theme.applyStyle(R.style.AppThemePrimary, true);
        }

        // you could also use a switch if you have many themes that could apply
        return theme;
    }
